/*Table structure for table `t_collect_website` */

DROP TABLE IF EXISTS `t_collect_website`;

CREATE TABLE `t_collect_website` (
  `id` bigint(20) NOT NULL,
  `name` bigint(20) DEFAULT NULL,
  `url` varchar(40) DEFAULT NULL,
  `icon` varchar(40) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `modify_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `t_collect_website` */

/*Table structure for table `t_dictionary` */

DROP TABLE IF EXISTS `t_dictionary`;

CREATE TABLE `t_dictionary` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `code` varchar(100) NOT NULL COMMENT '代码',
  `value` varchar(512) DEFAULT NULL COMMENT '值',
  `status` tinyint(4) NOT NULL COMMENT '状态：0-无效,1-有效',
  `description` varchar(200) DEFAULT NULL COMMENT '描述',
  `gmt_create` datetime NOT NULL COMMENT '创建时间',
  `gmt_modified` datetime NOT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `dict_code` (`code`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='字典表';

/*Data for the table `t_dictionary` */

/*Table structure for table `t_grading` */

DROP TABLE IF EXISTS `t_grading`;

CREATE TABLE `t_grading` (
  `id` bigint(20) NOT NULL,
  `code` varchar(20) DEFAULT NULL,
  `name` varchar(30) DEFAULT NULL,
  `another_name` varchar(30) DEFAULT NULL,
  `status` int(11) DEFAULT NULL,
  `province` int(11) DEFAULT NULL,
  `city` int(11) DEFAULT NULL,
  `district` int(11) DEFAULT NULL,
  `cbd` int(11) DEFAULT NULL,
  `estate_type` int(11) DEFAULT NULL,
  `estate_addr` varchar(60) DEFAULT NULL,
  `position_describe1` varchar(60) DEFAULT NULL,
  `position_describe2` varchar(60) DEFAULT NULL,
  `room_drawing` bigint(20) DEFAULT NULL,
  `map_drawing` bigint(20) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `modify_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `t_grading` */

/*Table structure for table `t_grading_info` */

DROP TABLE IF EXISTS `t_grading_info`;

CREATE TABLE `t_grading_info` (
  `id` bigint(20) NOT NULL,
  `grading_id` bigint(20) DEFAULT NULL,
  `traffic_describe` varchar(1000) DEFAULT NULL,
  `university` varchar(400) DEFAULT NULL,
  `school` varchar(400) DEFAULT NULL,
  `kindergarten` varchar(400) DEFAULT NULL,
  `mall` varchar(400) DEFAULT NULL,
  `post_office` varchar(400) DEFAULT NULL,
  `bank` varchar(400) DEFAULT NULL,
  `hospital` varchar(400) DEFAULT NULL,
  `other` varchar(400) DEFAULT NULL,
  `tel` varchar(400) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `modify_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `t_grading_info` */

/*Table structure for table `t_house_count` */

DROP TABLE IF EXISTS `t_house_count`;

CREATE TABLE `t_house_count` (
  `id` bigint(20) NOT NULL,
  `house_id` bigint(20) DEFAULT NULL,
  `click_num` int(11) DEFAULT NULL,
  `collect_num` int(11) DEFAULT NULL,
  `inform_num` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `t_house_count` */

/*Table structure for table `t_user` */

DROP TABLE IF EXISTS `t_user`;

CREATE TABLE `t_user` (
  `id` bigint(10) NOT NULL COMMENT '主键',
  `username` varchar(40) NOT NULL COMMENT '用户账号',
  `password` varchar(40) NOT NULL COMMENT '用户密码',
  `real_name` varchar(20) NOT NULL COMMENT '用户中文名称',
  `sex` tinyint(1) NOT NULL COMMENT '性别 0女 1男',
  `status` tinyint(1) NOT NULL COMMENT '用户状态 0 存盘 1启用 2 停用',
  `user_from` varchar(20) NOT NULL COMMENT '用户来源',
  `lock_status` tinyint(1) NOT NULL COMMENT '用户锁定状态 0未锁定 1已锁定',
  `dept_id` bigint(10) DEFAULT NULL COMMENT '用户部门',
  `phone` varchar(20) DEFAULT NULL COMMENT '手机号码',
  `email` varchar(40) DEFAULT NULL COMMENT '电子邮箱',
  `telephone` varchar(20) DEFAULT NULL COMMENT '座机号码',
  `address` varchar(100) DEFAULT NULL COMMENT '联系地址',
  `post_code` char(6) DEFAULT NULL COMMENT '邮编',
  `position` varchar(20) DEFAULT NULL COMMENT '职称',
